import { Searchbar } from 'react-native-paper';

export default function SearchBar() {
  const [searchQuery, setSearchQuery] = useForm({
    keyword: ''
  });

  return (
    <Searchbar
      placeholder="Search"
      onChangeText={onChangeSearch}
      value={searchQuery}
    />
  );
}
